import { describe, expect, test } from 'vitest';
import { request } from '../../../__tests__/utils';
describe('insertFile', () => {
    test('ok', async () => {
        const r1 = await request({
            url: 'http://prependbin.bodybin.appendbin.test.whistlejs.com/?doNotParseJson',
            method: 'post'
        });
        expect(r1.data).toBe(r1.res.body);
        expect(r1.data).toBe('我们是社会主义接班人!');
        const r2 = await request({
            url: 'http://prependbin.test.whistlejs.com/?resBody=',
            method: 'post'
        });
        expect(r2.data).toBe(r2.res.body);
        const r3 = await request({
            url: 'http://bodybin.test.whistlejs.com/?resBody=',
            method: 'post'
        });
        expect(r3.data).toBe(r3.res.body);
        const r4 = await request({
            url: 'http://appendbin.test.whistlejs.com/?resBody=',
            method: 'post'
        });
        expect(r4.data).toBe(r4.res.body);
        const r5 = await request({
            url: 'http://prependbin.bodybin.test.whistlejs.com/?resBody=',
            method: 'post'
        });
        expect(r5.data).toBe(r5.res.body);
        const r6 = await request({
            url: 'http://prependbin.appendbin.test.whistlejs.com/?resBody=',
            method: 'post'
        });
        expect(r6.data).toBe(r6.res.body);
        const r7 = await request({
            url: 'http://bodybin.appendbin.test.whistlejs.com/?resBody=',
            method: 'post'
        });
        expect(r7.data).toBe(r7.res.body);
    });
});
